backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    # Optionally add encryption
    encrypt = false
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./main.tf.code:
provider "random" {}

resource "random_pet" "name_postfix" {
  length    = 1
  separator = "_"
}

locals {
  parameter_name = "parameter_from_CloudAI_${random_pet.name_postfix.id}"
}

resource "aws_ssm_parameter" "cloudai_parameter" {
  name  = local.parameter_name
  type  = "String"
  value = "value"

  tags = {
    owner = "jeremy_wang"
  }
}

output "ssm_parameter_name" {
  value = aws_ssm_parameter.cloudai_parameter.name
}

./providers.tf.code:
provider "aws" {
  region = "us-east-1"
}

provider "random" {
  // Optionally, you can specify a version constraint for the Random provider
}
